script: |
  super -f text -I q13045.spq | sort > q13045.out

inputs:
  - name: q13045.spq
    data: |
      SELECT DISTINCT - 3 / col0 FROM tab0 (FORMAT parquet) WHERE NOT 85 * + 64 IN ( + + col0 + - col2, + 92, - col1 / + ( - col1 ) * col2 + - ( - + 16 ) - + col1 );
  - name: tab0

outputs:
  - name: q13045.out
    data: |
      0
